        [Test]
        public void When_to_not_empty_then_is_message_call()
        {
            Transaction transaction = new();
            transaction.To = Address.Zero;
            Assert.True(transaction.IsMessageCall, nameof(Transaction.IsMessageCall));
            Assert.False(transaction.IsContractCreation, nameof(Transaction.IsContractCreation));
        }

        [Test]
        public void When_to_empty_then_is_message_call()
        {
            Transaction transaction = new();
            transaction.To = null;
            Assert.False(transaction.IsMessageCall, nameof(Transaction.IsMessageCall));
            Assert.True(transaction.IsContractCreation, nameof(Transaction.IsContractCreation));
        }

        [TestCase(1, true)]
        [TestCase(300, true)]
        public void IsEip1559_returns_expected_results(int decodedFeeCap, bool expectedIsEip1559)
        {
            Transaction transaction = new();
            transaction.DecodedMaxFeePerGas = (uint)decodedFeeCap;
            transaction.Type = TxType.EIP1559;
            Assert.AreEqual(transaction.MaxFeePerGas, transaction.DecodedMaxFeePerGas);
            Assert.AreEqual(expectedIsEip1559, transaction.IsEip1559);
        }

        [TestCase]
        public void TestSigning()
        {
            var sszEncodedTx = "";
            var bs = Bytes.FromHexString(sszEncodedTx);
            var decodedTx = new TxDecoder<Transaction>().Decode(new RlpStream(bs), RlpBehaviors.SkipTypedWrapping);
           
            var desiredHash = "0xc27a43e3a2f6cbbf10429398b9800c7166385822aed9a1c4117ce84c35ec97b4";
            Assert.AreEqual(decodedTx.Hash, new Keccak(desiredHash));

            var sszEncodedFotTxHash = "";
            Assert.AreEqual(new TxDecoder<Transaction>().Encode(decodedTx).Bytes.ToHexString(), sszEncodedFotTxHash);

            var desiredTxRoot = "0x0e1ffb9c5fa4c6290584c16e3d0faa16dc939c62f9501eea1e57a6d3a9cf4fda";
            Keccak txRoot = new TxTrie(new[] { decodedTx }).RootHash;
            Assert.AreEqual(txRoot, new Keccak(desiredTxRoot));
        }

        [TestCase]
        public void TestE2e()
        {
            Transaction transaction = new();
            transaction.ChainId = 1;
            transaction.Nonce = 2;
            transaction.GasPrice = 3;
            transaction.DecodedMaxFeePerGas = 4;
            transaction.GasLimit = 5;
            transaction.To = new Address("0xffb38a7a99e3e2335be83fc74b7faa19d5531243");
            transaction.Value = 6;
            transaction.AccessList = new Eip2930.AccessList(new Dictionary<Address, IReadOnlySet<UInt256>> {
                { new Address("0x0000000000000000000000000000000000000007"), new HashSet<UInt256> { new UInt256(8) } } });
            transaction.MaxFeePerDataGas = 9;
            transaction.BlobVersionedHashes = new byte[][] { Bytes.FromHexString("0x0a0a79ce4615064fe51d10094c5882501b17f3c2aa50571dc3ea37be16980b0b") };
            transaction.Type = TxType.Blob;

            var d = new TxDecoder<Transaction>();
            var rlp = d.Encode(transaction).Bytes;
            var tx = d.Decode(new RlpStream(rlp), RlpBehaviors.SkipTypedWrapping);
        }

        [TestCase]
        public void TestE2e2()
        {
            var sszEncodedTransactionWithoutBlobs = Bytes.FromHexString("");
            var txHash = "0xbb2fccdf059574c642b3d2d7b2c1cbfc4db89e12d0770d13c5a987c7b3590bb3";
            var rlpEncoded = "";

            var decodedTx = MixedEncoding.Decode<Transaction>(sszEncodedTransactionWithoutBlobs, RlpBehaviors.SkipTypedWrapping);
            Assert.AreEqual(decodedTx!.Hash, new Keccak(txHash));

            var rlpEncodedTx = new TxDecoder<Transaction>().Encode(decodedTx, RlpBehaviors.SkipTypedWrapping);
            Assert.AreEqual(rlpEncoded, rlpEncodedTx.Bytes.ToHexString());
        }

        [TestCase]
        public void Eth62TransactionsReceived()
        {
            var txx = Bytes.FromHexString(File.ReadAllText("D:/Eth62TransactionsReceived.txt"));
            TransactionsMessage txMsg = new TransactionsMessageSerializer().Deserialize(txx);
            Assert.IsTrue(txMsg.Transactions.Count == 1);
        }



        [TestCase]
        public void TestE2eSsz()
        {
            var sszEncodedTransactionWithoutBlobs = Bytes.FromHexString("");
            var txHash = "0xbb2fccdf059574c642b3d2d7b2c1cbfc4db89e12d0770d13c5a987c7b3590bb3";
            var rlpEncoded = "";

            var decodedTx = MixedEncoding.Decode<Transaction>(sszEncodedTransactionWithoutBlobs, RlpBehaviors.SkipTypedWrapping | RlpBehaviors.NetworkWrapper);
            Assert.AreEqual(decodedTx!.Hash, new Keccak(txHash));

            var sszEncoded = MixedEncoding.Encode<Transaction>(decodedTx, RlpBehaviors.SkipTypedWrapping);
            Assert.AreEqual(rlpEncoded, sszEncoded.ToHexString());
        }

        [TestCase]
        public void TestE2e3()
        {
            bool again = true;
            while (again)
            {
                again = false;
                try
                {
                    Transaction transaction = new();
                    transaction.Type = TxType.Blob;

                    transaction.ChainId = 1;
                    transaction.Nonce = 2;
                    transaction.GasLimit = 3;
                    transaction.DecodedMaxFeePerGas = 4;
                    transaction.GasPrice = 5;
                    transaction.MaxFeePerDataGas = 6;
                    transaction.Value = 7;

                    transaction.To = new Address("0xffb38a7a99e3e2335be83fc74b7faa19d5531243");
                    transaction.AccessList = new AccessList(new Dictionary<Address, IReadOnlySet<UInt256>> {
                        { new Address("0x1000000000000000000000000000000000000007"), new HashSet<UInt256> {
                            new UInt256(8),
                            new UInt256(8 << 25),
                        } } });
                    var bvha = new byte[32];
                    bvha[0] = 42;
                    transaction.BlobVersionedHashes = new byte[][] { bvha };
                    var data = new byte[33];
                    data[0] = 19;
                    transaction.Data = data;




                    EthereumEcdsa ethereumEcdsa = new(1, LimboLogs.Instance);

                    PrivateKey privateKey = new PrivateKey(Bytes.FromHexString("45a915e4d060149eb4365960e6a7a45f334393093061116b197e3240065ff2d8"));
                    ethereumEcdsa.Sign(privateKey, transaction, true); 
                    var sszEncoded = MixedEncoding.Encode<Transaction>(transaction, RlpBehaviors.SkipTypedWrapping);
                    var d = sszEncoded.ToHexString();

                    var decodedTx = MixedEncoding.Decode<Transaction>(sszEncoded, RlpBehaviors.SkipTypedWrapping);

                    Assert.AreEqual(transaction.ChainId, decodedTx.ChainId);
                    Assert.AreEqual(transaction.Nonce, decodedTx.Nonce);
                    Assert.AreEqual(transaction.GasPrice, decodedTx.GasPrice);
                    Assert.AreEqual(transaction.DecodedMaxFeePerGas, decodedTx.DecodedMaxFeePerGas);
                    Assert.AreEqual(transaction.To, decodedTx.To);
                    Assert.AreEqual(transaction.Value, decodedTx.Value);
                    Assert.AreEqual(transaction.AccessList.Data.First().Key, decodedTx.AccessList!.Data.First().Key);
                    Assert.AreEqual(transaction.AccessList.Data.First().Value.First(), decodedTx.AccessList.Data.First().Value.First());
                    Assert.AreEqual(transaction.MaxFeePerDataGas, decodedTx.MaxFeePerDataGas);
                    Assert.AreEqual(transaction.BlobVersionedHashes, decodedTx.BlobVersionedHashes);
                    Assert.AreEqual(transaction.Type, decodedTx.Type);
                    Assert.AreEqual(decodedTx!.Hash, new Keccak("0x0e9ffc0acf92fbf5cd2f00a183c040c72d762a0ca6c3a9ea7794816c41c48b55"));


                    Merkleization.Merkle.Ize(out Dirichlet.Numerics.UInt256 merkleRoot, decodedTx);
                    Merkleization.Merkle.Ize(out Dirichlet.Numerics.UInt256 merkleRootTx, transaction);
                    Assert.AreEqual(merkleRoot, merkleRootTx);


                    transaction.Proof = Enumerable.Range(1, 48).Select(x=>(byte)x).ToArray();
                    transaction.BlobKzgs = new byte[][] { Enumerable.Range(1, 48).Select(x => (byte)x).ToArray() };
                    transaction.Blobs = new byte[][] { Enumerable.Range(1, 4096 * 32).Select(x => (byte)(x % 250)).ToArray() };
                    sszEncoded = MixedEncoding.Encode<Transaction>(transaction, RlpBehaviors.SkipTypedWrapping | RlpBehaviors.NetworkWrapper);
                    d = sszEncoded.ToHexString();

                    decodedTx = MixedEncoding.Decode<Transaction>(sszEncoded, RlpBehaviors.SkipTypedWrapping | RlpBehaviors.NetworkWrapper);
                    sszEncoded = MixedEncoding.Encode<Transaction>(decodedTx, RlpBehaviors.SkipTypedWrapping | RlpBehaviors.NetworkWrapper);
                    var d2 = sszEncoded.ToHexString();
                    Assert.AreEqual(d, d2);

                }
                catch
                {
                    again = true;
                }
            }
        }

    }
